import { Component } from "@angular/core";
// services
import { AppConfig } from "../common/appConfig";

@Component({
  // #region template
  template: "\n\n<view-fader [isViewVisible]=\"isViewVisible\">\n  <h2 class=\"splash-feature-title\" style=\"font-family: px-neuropol; \">Technology Stack</h2>\n</view-fader>\n\n<expand-visible [isVisible]=\"image0Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n\n<expand-visible [isVisible]=\"image1Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n\n<expand-visible [isVisible]=\"image2Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n\n<expand-visible [isVisible]=\"image3Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n\n<expand-visible [isVisible]=\"image4Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n\n<expand-visible [isVisible]=\"image5Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n\n<expand-visible [isVisible]=\"image6Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n\n<expand-visible [isVisible]=\"image7Visible\" class=\"expand-visible\">\n  <img alt=\"\" src=\"data:image/png;base64,\" class=\"splash-feature-image\" />\n</expand-visible>\n"/* this was squashed */
  // #endregion
})
export class SplashComponent {
  private isViewVisible = true;
  private image0Visible = false;
  private image1Visible = false;
  private image2Visible = false;
  private image3Visible = false;
  private image4Visible = false;
  private image5Visible = false;
  private image6Visible = false;
  private image7Visible = false;
  private sequence = 0;

  constructor(private readonly ac: AppConfig) {
  }

  ngOnInit() {
    this.ac.waitUntilInitialized(() => {
      this.isViewVisible = true;
      this.switchImages();
    });

  }

  private switchImages() {
    setInterval(() => {
      if (this.sequence === 8)
        this.sequence = 0;

      this.image0Visible = false;
      this.image1Visible = false;
      this.image2Visible = false;
      this.image3Visible = false;
      this.image4Visible = false;
      this.image5Visible = false;
      this.image6Visible = false;
      this.image7Visible = false;
      switch (this.sequence) {
        case 0:
          this.image0Visible = true;
          break;
        case 1:
          this.image1Visible = true;
          break;
        case 2:
          this.image2Visible = true;
          break;
        case 3:
          this.image3Visible = true;
          break;
        case 4:
          this.image4Visible = true;
          break;
        case 5:
          this.image5Visible = true;
          break;
        case 6:
          this.image6Visible = true;
          break;
        case 7:
          this.image7Visible = true;
          break;
      }
      this.sequence++;
    }, 2000);
  }

}
